script: |
  super -f text -I q4239.spq | sort > q4239.out

inputs:
  - name: q4239.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 IN ( + + col0 - col0 * 97, + col0, 96 * - 2 * - + col0 + - col1, - 60, 77 * - col1 );
  - name: tab2

outputs:
  - name: q4239.out
    data: |
      46	51	23
      64	77	40
      75	67	58
